'use strict';function InputTextProcessor(current_text){this.__init__(current_text);}
const CURSOR_COLOR='#a92200';InputTextProcessor.prototype={current_text:null,__init__:function(current_text){this.current_text=current_text;},parse_key_event:function(event){var key_code=event.keyCode;if(key_code===KEY_CODE_DELETE){if(this.current_text.length>0){this.current_text=this.current_text.slice(0,-1);}}else if(event.key.length===1){this.current_text+=event.key;}
},clear_text:function(){this.current_text='';},get_text:function(){return this.current_text;}};